webpackJsonp([0xd2ed224b7a25],{5127:function(e,t){e.exports={data:{post:{html:"<p>I'm doing way too much. Overtime at work... we're launching our main site at the end of the month, I need to put together a quick bug database for Hanover 'by yesterday', and Leipzig needshelp importing a banking frontend into Lotus Notes. And I should really help Singapore for a few days, but don't know when or if I can fit it in. </p>\n<p>And of course, there is the small matter of a wife and son at home that are much more important than anything at work and need daily attention. So the weblog is suffering. So it goes.</p>\n<p><a href=\"http://www.cnn.com/2000/WORLD/europe/08/16/russia.submarine.01/index.html\"><br />\nThe sunken Russian submarine</a> is the main story here, with special reports after the Tagesschau. I suffered extreme claustrophobia just from reading the submarine scenes in <a href=\"http://www.cryptonomicon.com/\">Cryptonomicon</a>.</p>",fields:{title:"Way too busy...",date:"16 Aug 2000",url:"https://papascott.de/2000-08-16-way-too-busy/"}}},pathContext:{slug:"/2000-08-16-way-too-busy/",prev:{fields:{title:"Ginger Rennt",date:"13 Aug 2000",slug:"/2000-08-13-ginger-rennt/"}},next:{fields:{title:"Full coverage",date:"18 Aug 2000",slug:"/2000-08-18-full-coverage/"}}}}}});
